import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD App with Mearn</h1>
      <label>Food Name:</label>
      <input type="text"/>
      <label>Days Since You Ate It:</label>
      <input type="number"/>
    </div>
  );
}

export default App;
